      "body": "<p data-block-key=\"07tbi\">Welcome to my portfolio! I'm Josh, a seasoned full-stack developer with a passion for crafting exceptional web and mobile experiences. My expertise lies in harnessing the power of technologies like React, React Native, Node.js, and Django to bring ideas to life.</p><p data-block-key=\"cf7l5\">Previously, I honed my skills at Amazon, contributing as a Frontend Engineer in the advertising sales Performance department. This experience equipped me with a deep understanding of creating high-performance, user-centric solutions in fast-paced environments.</p><p data-block-key=\"1oqku\">Armed with a degree in Computer Engineering from Purdue University, I bring a unique blend of technical prowess and creative problem-solving to every project. Beyond web and mobile development, I thrive in assisting with hardware integration for internet-enabled devices and leveraging CAD for design and manufacturing.</p><p data-block-key=\"4ho75\">Whether you're seeking sleek user interfaces, robust backend systems, or innovative hardware solutions, I'm here to turn your vision into reality. Let's collaborate and bring your ideas to life!</p>",
