      "title": "SIMON - Malls, Mills & Outlets",
      "body": [
        {
          "type": "full_richtext",
          "value": "<h2 data-block-key=\"sbva0\"><b>Challenge</b></h2><p data-block-key=\"fule\">I joined this project midway through, as the previous developer wasn't meeting expectations. Hired in August with a hard deadline of October, our goal was to launch before the holiday season rush. With just over a month to deliver and only one other developer on board, we had our work cut out for us.</p><p data-block-key=\"8rkhd\">While our timeline was tight, we prioritized functionality over perfection to ensure the application was usable. The primary objective was to consolidate Simon's multiple mobile apps into one cohesive experience, streamlining maintenance for developers and enhancing user satisfaction, ultimately aiming for higher ratings in app stores.</p>",
          "id": "7e9f2c76-ac0c-48c8-838a-585e371ba9b4"
        },
        {
          "type": "full_richtext",
          "value": "<h2 data-block-key=\"sbva0\">Solution</h2><p data-block-key=\"n4i\">To achieve our goals efficiently, we opted for React Native as the framework. This decision allowed Simon's developers to maintain a single codebase for both Android and iOS versions, simplifying updates and reducing development overhead.</p><p data-block-key=\"cpdu1\">Identifying issues with Simon's APIs, I collaborated closely with their developers to address and rectify them, ensuring seamless data retrieval for the application.</p><p data-block-key=\"b4ctg\">Despite time constraints, we put in extra hours to meet the holiday season deadline, albeit sacrificing some optimizations, particularly in initial load times and performance.</p>",
          "id": "49e1123f-2505-45ff-9f6b-015496e13863"
        },
        {
          "type": "full_richtext",
          "value": "<h2 data-block-key=\"sbva0\">Result</h2><p data-block-key=\"45ipm\">We successfully launched the application within the set timeframe, delivering on all promised features.</p><p data-block-key=\"anuae\">To enhance performance, we optimized data loading by reducing initial requests and implementing loaders and placeholders to indicate ongoing data retrieval. Additionally, we restructured application components, resulting in an impressive 80% decrease in load times.</p><p data-block-key=\"or2d\">Pixel-perfect implementations based on Figma designs were delivered, ensuring a visually appealing user experience.</p><p data-block-key=\"824gg\">Post-launch, I provided ongoing support, addressing bugs and introducing new features, demonstrating our commitment to the project's long-term success.</p><p data-block-key=\"cagpq\">Furthermore, we improved accessibility by increasing touchpoint sizes and incorporating alternate text fields.</p>",
          "id": "df18fc32-7ee1-4ee5-82a2-3631b200ec3d"
        },
        {
          "type": "full_richtext",
          "value": "<h2 data-block-key=\"sbva0\"><b>Impact</b></h2><p data-block-key=\"1cu5g\">The application's App Store rating skyrocketed from 3.5 stars to an impressive 4.9, reflecting the significant improvement in user satisfaction.</p><p data-block-key=\"cs3cv\">By streamlining development with React Native and optimizing performance, we effectively lowered overhead and maintenance costs for Simon.</p><p data-block-key=\"6hdkt\">Internally, the project was hailed as a major success, solidifying our partnership with Studio Science and showcasing our ability to deliver under pressure.</p><p data-block-key=\"a4eu2\">Feel free to check out the app on the <a href=\"https://www.google.com/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=&amp;cad=rja&amp;uact=8&amp;ved=2ahUKEwjAyavAjMr9AhW2mmoFHa7MDswQFnoECAsQAQ&amp;url=https%3A%2F%2Fapps.apple.com%2Fus%2Fapp%2Fsimon-malls-mills-outlets%2Fid395128180&amp;usg=AOvVaw3W3nYvUbA_0wbdf69Kr7BR\">App Store</a> or <a href=\"https://www.google.com/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=&amp;cad=rja&amp;uact=8&amp;ved=2ahUKEwjAyavAjMr9AhW2mmoFHa7MDswQFnoECBkQAQ&amp;url=https%3A%2F%2Fplay.google.com%2Fstore%2Fapps%2Fdetails%3Fid%3Dcom.simon.app.simonmalls%26hl%3Den_US%26gl%3DUS&amp;usg=AOvVaw3LpN6IzFxkuNyW3h0mQ-ws\">Play Store</a> to experience the results firsthand</p>",
          "id": "e35ef87c-8c80-4e3b-b2de-2cd3c7bc30b0"
        },
        {
          "type": "full_richtext",
          "value": "<h2 data-block-key=\"sbva0\">Reference:</h2><ul><li data-block-key=\"cdbl\"><a href=\"https://studioscience.com/case-studies/simon/\">Studio Science [case study]</a></li><li data-block-key=\"4vplc\"><a href=\"https://www.sethrichardsondesign.com/simon\">Explore the mall like a VIP - Seth Richardson</a><br/></li></ul>",
          "id": "a284a746-1201-45da-81a4-e823913e7031"
        }
      ],
